import React from 'react';

const ProjectDevelopment = () => {
  return (
    <div className='background middle center gapLines'>
                <div className='line projectHeaderLine'>

          <motion.div onClick={() => navigate("development")} whileTap={{scale: 0.9}} whileHover={{scale: 1.03}} initial={{ opacity: 0, scale: 0.8 }} animate={{ opacity: 1, scale: 1 }} exit={{scale: .91 }} transition={{ type: "spring", duration: 0.6 }} className='projectHeader toTheEnd changesButton'>
            <h1>Development</h1>
          </motion.div>
        </div>

        <div className='line projectListFiles'> 
        <div className='FileLine'>
            <span className='FileText'>g</span>
            <span className='FileText'>Change Proposer</span>
        </div>
        </div>

    </div>
  );
}

export default ProjectDevelopment;
